package ourwork;

import java.util.Scanner;

public class Swapping {
	    public static void main(String[] args) {
	        // TODO Auto-generated method stub
	        int x=12, y=56, temp;

	        System.out.println("Before Swapping" + x + y);
	        temp = x;
	        x = y;
	        y = temp;
	        System.out.println("After Swapping" + x + y);
	         
	    }
	 
	}
